    <header class="dm-c-pageHeader" role="banner">

        <h1 class="dm-c-pageHeader_title">
            A new calendar approach for 2017
        </h1>

        <h2 class="dm-c-pageHeader_date">January 15, 2017 at 3:53 <abbr title="Post Meridien">PM</abbr></h2>

    </header><!-- .page-header -->

    <script async type="text/javascript" src="//cdn.carbonads.com/carbon.js?zoneid=1696&amp;serve=CVYD42T&amp;placement=danielmallcom" id="_carbonads_js"></script>

    <main role="main" class="dm-c-articleWell">

        <div class="dm-dp-textPassage">


            <p>
                <span class="dm-dp-openingLines">Four weeks ago</span>, I revamped my whole approach to using a calendar.
            </p>

            <p>
                After seeing it mentioned on Twitter from a few people, I purchased <a href="https://twitter.com/jkglei">Jocelyn Glei</a>&rsquo;s <cite>Unsubscribe</cite> and devoured it on a long flight. Inspired by the ideas from this book and other sources, I started to redo my calendar and rethink my entire approach to working.
            </p>




            <h2 id="first-up-email">
                First up: email
                <a class="dm-dp-anchorLink" href="#first-up-email">#</a>
            </h2>

            <p>
                I have 6 email accounts, and some back-of-the-napkin math tells me I get about 220 emails on weekdays (not including spam). That&rsquo;s 83% more than the average 121 emails per day most people get as <a href="http://www.radicati.com/wp/wp-content/uploads/2015/02/Email-Statistics-Report-2015-2019-Executive-Summary.pdf">reported by technology market research firm Radicati (<abbr title="Portable Document Format">PDF</abbr>, 600<abbr title="Kilobytes">KB</abbr>)</a>. That&rsquo;s probably not as much email as some of you reading this might get, but it&rsquo;s certainly enough to overwhelm me.
            </p>

            <p> 
                A quick look through my <a href="https://www.getharvest.com/">Harvest</a> data tells me that I worked 868 hours in 2016, 135 of which went to non-project-related email&mdash;just over 15%. (For the curious, that roughs out to processing about 366 emails/hour, though that includes a hefty bit of automation like Gmail rules for auto-archiving and services like <a href="https://unroll.me/">Unroll.me</a>). Although I wish otherwise, I don&rsquo;t really see a way to run my business without email&mdash;hence the significant portion of my workload&mdash;so I&rsquo;m always open to better ways to manage this volume.
            </p>

            <p>
                One of my favorite things about <cite>Unsubscribe</cite> is that it doesn&rsquo;t jump right into the tactical. Instead, Jocelyn starts by tackling what she calls the &ldquo;neuroscience and cultural baggage that shape our conflicted feelings about email.&rdquo; For me, it helps to understand <em>why</em> an approach might work before attempting to implement it. This passage really spoke to me:
            </p>

            <blockquote>
                <p>
                    Once you start thinking of the irksome email requests you get as someone just throwing spaghetti at the wall and thinking, &ldquo;Who knows what they&rsquo;ll say? I&rsquo;ll just give it a shot!,&rdquo; it really takes the pressure off. You no longer assume they&rsquo;re expecting you to say yes, and it becomes much easier to say no (<abbr title="page">p</abbr>. 36).
                </p>
            </blockquote>

            <p>
                In other words, Jocelyn is <a href="http://danielmall.com/articles/permission-slips/">giving me permission</a> to not have to answer every email. This is much more in line with an approach I&rsquo;ve been adopting in other areas of my life and work: accepting the firehose.  
            </p>





            <h2 id="accepting-the-firehose">
                Accepting the firehose
                <a class="dm-dp-anchorLink" href="#accepting-the-firehose">#</a>
            </h2>

            <p>
                I used to love <a href="http://www.whatisrss.com/">RSS</a>. It was the main way I kept up-to-date with all the things going on in the industry. But, as information increased, my <abbr>RSS</abbr> feeds quickly got to the point where I could no longer keep up, and it was stressing me out to feel like I was on top of it.
            </p>

            <p>
                Along came <a href="https://twitter.com/shauninman">Shaun Inman</a>&rsquo;s <a href="http://feedafever.com/">Fever</a>. It was a different kind of <abbr>RSS</abbr> reader, in that it surfaced information according to its traction rather than its chronology. That became a crucial philosophy in how I felt I could manage the firehouse of increasing info: the important stuff would rise to the top, so I could worry less about the stuff that didn&rsquo;t. I was then free to add as many feeds as I wanted, as I figured the good stuff would make its way to me, not the other way around. My strategy with Twitter was similar: where I used to keep the number of accounts I followed to a minimum so that I could keep up, I now follow whomever I want and figure the good stuff will make its way to me. Unlike many, I highly value all the different flavors of &ldquo;what you missed&rdquo; functionality that social networks are starting to build in.
            </p>

            <p>
                But this approach never made its way to my email. For a few years, I&rsquo;ve been an <a href="http://mashable.com/2013/10/10/inbox-zero/#Y4M8N2WGZsqL">Inbox Zero</a> kinda guy. Never really achieving it for long, my unified inbox has hovered at about 50 messages for the last six months. With <cite>Unsubscribe</cite>&rsquo;s &ldquo;you don&rsquo;t owe anyone anything&rdquo; reminder, I think I&rsquo;m ready to accept the email firehose. That means I&rsquo;m making peace with the idea that I have more email than I can get to, and not all of it deserves my attention. I&rsquo;ve written about <a href="http://danielmall.com/articles/i-dont-have-time/">priorities</a> before; now it&rsquo;s time for some <a href="https://en.wikipedia.org/wiki/Eating_your_own_dog_food">dogfooding</a> as it relates to managing email. (Ironically, letting go of the Inbox Zero mentality has gotten me closer to Inbox Zero than I&rsquo;ve been in a long while.)
            </p>









            <h2 id="calendar-half-full">
                Calendar half-full
                <a class="dm-dp-anchorLink" href="#calendar-half-full">#</a>
            </h2>

            <p>
                Some of the first things I work on with <a href="http://superfriend.ly/academy/">my apprentices</a> are evaluating useful approaches to time management. For some of them, it&rsquo;s the first time they&rsquo;ve ever relied on a calendar to help them structure their days. Where do you start with a blank slate?
            </p>

            <p>
                My most frequently recommended piece of reading is <a href="https://twitter.com/jessicahische">Jessica Hische</a>&rsquo;s <a href="http://jessicahische.is/thinkingthoughtsonscheduling">Productivity Quest: Ultra-Schedule</a>, specifically step 5. I love the idea that she starts every week with a <em>full</em> calendar, as opposed to an empty calendar that needs filling. I&rsquo;ve always defaulted to the idea that my main work would fit in the empty slots, <em>after</em> everything else has been scheduled. (Just writing that out makes me realize now how silly that was.) Instead, I very much recognize the value in having the most important things scheduled. Eileen Webb touches on this idea too in her post, &ldquo;<a href="https://superyesmore.com/productivity-in-terrible-times-709d4b3127d845e2d090bf94f0b93263">Productivity in Terrible Times</a>.&rdquo;
            </p>

            <p>
                So I set out to block out a boilerplate calendar for each day that could be filled-in with further details as I got to them. This is what that boilerplate looks like:
            </p>

