            <h3 id="mission-mornings">
                Meaningful mornings
                <a class="dm-dp-anchorLink" href="#mission-mornings">#</a>
            </h3>

            <p>
                In <cite>Unsubscribe</cite>, Jocelyn suggests starting every morning with what she calls <em>meaningful work</em>, which she defines as &ldquo;work that contributes to your legacy, helps you advance your career, expands your skill set, etc.&hellip; When you finish such work, you have the satisfying feeling of time well spent and a job well done.&rdquo; This work should happen before doing any other work, especially checking email. She reasons that, by doing meaningful work for the first 60&ndash;90 minutes of your day, no matter what happens later that day, you will have advanced your personal mission.
            </p>

            <p>
                This reminds me of the talk, &ldquo;<a href="http://99u.com/videos/53977/ryan-carson-begin-with-the-end-in-mind">Begin With the End in Mind</a>&rdquo; by <a href="https://twitter.com/ryancarson">Ryan Carson</a> at <a href="http://conference.99u.com/past-conferences/year-2016">the 2016 99u conference</a>. Ryan&rsquo;s thesis is that accomplishing what matters to you is much more attainable when you schedule time on your calendar to make it happen.
            </p>

            <p>
                After some reflection, I&rsquo;ve narrowed my current personal mission to this: <strong>connecting people to opportunities they might not have on their own.</strong> I&rsquo;ve identified four goals I&rsquo;d like to accomplish over the next quarter that advance my personal mission, and have post-its on my desk that remind me of these goals constantly. In no particular order:
            </p>

            <ol>
                <li>Launch a new <a href="http://superfriend.ly/">SuperFriendly site</a> that shows how we&rsquo;ve connected clients to new opportunities in their businesses.</li>
                <li>Launch a new <a href="http://danielmall.com/">personal website</a> that better shows agency owners and product teams and how I can coach and mentor them to get better work and/or get better at it.</li>
                <li>Move <a href="http://superbooked.com/">SuperBooked</a> into public beta so that freelancers and agency owners can more effectively find and share work.</li>
                <li>Release the podcast I&rsquo;ve been working on about apprenticeships, mentorship, learning, and teaching in the workplace.</li>
            </ol>

            <p>
                (I have some more specific <abbr>OKR</abbr>s&mdash;<a href="https://library.gv.com/how-google-sets-goals-okrs-a1f69b0b72c7#.xs17boxi4">Objectives &amp; Key Results</a>&mdash;for each of these, but that&rsquo;s a post for another time.)
            </p>

            <p>
                I&rsquo;ve been an early riser for the last 7 years; I&rsquo;m generally up at 5<abbr title="Ante Meridian">am</abbr> most weekdays. My workday starts at 5:30<abbr>am</abbr>, and I spend the first hour dedicated to one of these four things. Which one I work on is determined by which one I&rsquo;m most excited about that morning.
            </p>




            <h3 id="daily-work-slots">
                Daily Work slots
                <a class="dm-dp-anchorLink" href="#daily-work-slots">#</a>
            </h3>

            <p>
                I scheduled time for daily work. Having scheduled time for work is pretty new for me, but I immediately love it. Knowing that I&rsquo;m guaranteed 3&half; hours every day <em>during work hours</em> to do my work reduces a lot of my anxiety about the whens and hows of getting things done.
            </p>



            <h3 id="call-slots">
                Call slots
                <a class="dm-dp-anchorLink" href="#call-slots">#</a>
            </h3>

            <p>
                I scheduled call slots. I&rsquo;m on the phone (hangouts and Skype included) <em>a lot</em>. Between work reviews, team meetings, new business, and just liking to talk to people, I think this was the biggest detriment to my productivity. I&rsquo;d randomly schedule calls whenever the other party was available, cutting short my own momentum in getting work done.
            </p>

            <p>
                Looking back at the last few months, I averaged just over 6 scheduled calls/week, and I know there were a handful of unscheduled calls each week too. Having 10 slots for calls gives me the stability of knowing my momentum won&rsquo;t be disrupted. A big part of productivity is prioritizing, and scheduled call slots let me prioritize my work while giving me a rationale for why I won&rsquo;t do a call at 2<abbr title="Post meridien">pm</abbr>. I&rsquo;m working my way up to the <a href="https://m.signalvnoise.com/warren-buffet-on-scheduling-meetings-f0826c0e88f6#.rbq25jqgy">Warren Buffet-style one-day-advance method</a>, but for now, this works great for me.
            </p>

            

            <h3 id="email-checking-slots">
                Email checking slots
                <a class="dm-dp-anchorLink" href="#email-checking-slots">#</a>
            </h3>

            <p>
                Per <cite>Unsubscribe</cite>&rsquo;s recommendation, I have a morning and afternoon slot for checking email, Twitter, Slack, and even sorting through snail mail. These slots are the only times that these apps are open; otherwise, they&rsquo;re closed. One small suggestion the book makes is to move to a different physical location during these times to mentally establish switching gears. I have yet to put this into practice but will be trying to soon. I&rsquo;ll likely do something like making my iMac or Surface Book my work machine and then only checking and responding to email on my laptop or iPad so that I get the full experience of context switching.
            </p>
            <p>
                <cite>Unsubscribe</cite> also makes many specific suggestions that I won&rsquo;t mention here on how to make the most of these times, so <a href="http://amzn.to/2jaevjG">go buy it</a> if you&rsquo;re curious. 
            </p>




            <h3 id="setting-up-tomorrow-slots">
                Setting up tomorrow slots
                <a class="dm-dp-anchorLink" href="#setting-up-tomorrow-slots">#</a>
            </h3>

            <p>
                The last slot of the day is devoted to filling in tomorrow&rsquo;s tasks. All the slots in green and/or with brackets around the title indicate slots that need more specificity. At the end of each day, I&rsquo;ll change a general &ldquo;<var>[Daily Work]</var>&rdquo; slot to something more specific like &ldquo;Comps for [Client],&rdquo; &ldquo;Write proposal for [Client],&rdquo; &ldquo;[Client naming exercise] &rdquo; etc. Green means it needs to be scheduled; once it&rsquo;s filled-in, it changes to orange. If a call slot hasn&rsquo;t been booked by the end of the previous day, it turns into a &ldquo;Daily Work&rdquo; slot.
            </p>




            <h2 id="whats-next">
                What&rsquo;s next
                <a class="dm-dp-anchorLink" href="#whats-next">#</a>
            </h2>

            <p>
                The last four weeks of trying this&mdash;holiday break notwithstanding&mdash;has moved my work-to-email ratio from something like 50/50 to more like 60/40. A tiny improvement, but I think it&rsquo;s headed in the right direction. Also, while the statistical significance is small, the addition of meaningful mornings makes me <em>feel</em> much more accomplished every day, and that&rsquo;s a big deal for me.
            </p>

            <p>
                As I try this out more, there are a few reminders I&rsquo;ll need to keep top-of-mind and missing things I&rsquo;ll be looking to integrate:
            </p>

            <ul>
                <li>
                    <strong>Flexibility.</strong> Even though the rigidity of this schedule is its strength, I know I&rsquo;ll need to be flexible about how it bends. I&rsquo;ll try not to break work momentum with more calls, but I&rsquo;ll also be open to transforming a call slot into an email slot if the day calls for it. I&rsquo;ve also noticed that having time blocks set up allow me to switch things, so some days have me eating an earlier lunch to accommodate a noon-time call or later lunch if I have some morning momentum and want to keep working through. I also allow myself to work longer on busier days and try to turn in early on others.
                </li>
                <li>
                    <strong>Family time.</strong> Weekends and everything after 6<abbr>pm</abbr> on weekdays is family time, and I don&rsquo;t check email at all during these times. I haven&rsquo;t specifically put these times on my calendar, mostly because I&rsquo;m not around a calendar to need to know what to do, but I also realize how that conflicts with the &ldquo;schedule it if it&rsquo;s important&rdquo; theory. Ok, I <em>just</em> put it on the calendar this very second, so I&rsquo;ll see how that goes. 
                </li>
                <li>
                    <strong>Exercise.</strong> There&rsquo;s nothing here about exercise, and honestly, I&rsquo;m struggling to figure out where it can fit. I know it&rsquo;s important, but I just don&rsquo;t like early morning or late evening workouts and finding time during the day feels really disruptive. I&rsquo;ve joined a sort-of dad&rsquo;s pick-up basketball league where we play just about every Friday night from 11<abbr>pm</abbr> to about 2<abbr>am</abbr>, and my wife and I will usually do a few hours of racquetball every Sunday, so exercise isn&rsquo;t completely absent from the routine. Still though, I&rsquo;d like to integrate it more into work days. I think I&rsquo;ll have to simply decide it&rsquo;s a priority and sacrifice other things for it.
                </li>
                <li>
                    <strong>Better mornings and nights.</strong> I&rsquo;ve recently discovered <a href="https://benjaminhardy.com/links/">the writings of organizational psychologist Benjamin Hardy</a>, who has a lot of good to say about what makes for <a href="https://benjaminhardy.com/8-things-every-person-should-do-before-8-a-m-2/">great mornings</a> and <a href="https://benjaminhardy.com/8-things-every-person-should-do-after-8-p-m/">great nights</a>, among other things. His advice works in recommendations about diet, sleep, screen time, prayer, showers, reading, journaling and more&hellip; all things I&rsquo;d like to be more intentional about in my daily life.
                </li>
            </ul>

            <p>
                As always, it&rsquo;s a grand experiment. I&rsquo;ve set all of these calendar slots to expire on March 31, 2017, so it&rsquo;ll be a full quarter of giving this a shot. Follow me at <a href="http://twitter.com/danmall">@danmall</a> on Twitter to see if I stick with it!
            </p>

